import React from "react";
import Data from "./Data";

const Work = () => {
	return (
		<>
			<section className="work">
				<div className="heading">
					<h3>My WORKS</h3>
					<h1>Some of my competeid works</h1>
				</div>
				<div className="content">
					{
						Data.map((val) => {
							return (
								<>
									<div className="box">
										<div className="img">
											<img src="" alt=""/>
										</div>
									</div>
								</>
							);
						})
					}
				</div>
			</section>
		</>
	);
};

export default Work;
